import React from 'react';

export default function ChatUsers() {
    const users = [
        { id: 1, name: 'John', profileImgUrl: '', lastMsg: 'oky, call me.' },
        {
            id: 2,
            name: 'Kelvin',
            profileImgUrl: '',
            lastMsg: 'I am still waiting ser',
        },
    ];

    return <div className="bg-cyan-500"></div>;
}
